import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./Header.css"
import App from '../Out/Products/Products';
class Header extends Component {
  render(){
  return (
        <div className=" header-top " >
              <div className="abc ">
                <i class="fas fa-user space-left" > Đăng Ký</i>
                <i class="fas fa-sign-in-alt space-right"> Đăng nhập </i>
                {/* <div class="fas fa-camera"> <strong ><b>Album</b></strong></div> */}
              </div>
              {App}
              <App></App>
        </div>
  );
}}

export default Header;
